import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Landing from './components/Landing';

function App() {
  return <Router>
    <Switch>
      <Route exact path='/' element={<Landing />} />
    </Switch>
  </Router>
}

export default App;
